import React from "react";

export default function Header() {
  return (
    <div className="header">
      <img src=".images/golden_gryphon_logo.png" alt="Golden Gryphons" />
      <h1 style={{ color: "#a18525" }}>Golden Gryphons</h1>
    </div>
  );
}
